import Home from './components/Home/Home';

class App extends React.Component {
  render() {
  return (
    <div className="container">
      <Router>
    <Route exact path="/">
      <Redirect to="/Home"/>
    </Route>


    <Navbar/>

    </Router>
    </div>
  );
}
}

export default App;
